import React, { Fragment } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import AdminLoginForm from './AdminLoginForm';
import SubAdmin from './SubAdmin';
import AddSubAdminForm from './AddSubAdminForm';
import SubAdminId from './SubAdminId';
import Navbar from './Navbar';
import './App.css';

function App() {
  return (
    <Router>
      <Fragment>
        <Navbar />
        <Switch>
          <Route exact path='/' component={AdminLoginForm} />
          <Route exact path='/subAdmin' component={SubAdmin} />
          <Route exact path='/subAdmin/add' component={AddSubAdminForm} />
          <Route exact path='/subAdmin/add/:id' component={SubAdminId} />
        </Switch>
      </Fragment>
    </Router>
  );
}

export default App;
